function Prob8(){

	var number = ""
	
	//Brute force search with slight optimization
	//Moving window of product (this really isn't necessary but whatever)
	//Bottleneck is probably string to number conversion;
	this.eval = function(){
		var length = number.length;
		var maxProduct = parseInt(number[0])*parseInt(number[1])*parseInt(number[2])*parseInt(number[3])*parseInt(number[4]);
		var product = maxProduct;

		for(var i = 1; i<length-5; i++){
			product *= parseInt(number[i+4]);
			var d = parseInt(number[i-1]);
			//Special case if d == 0
			if(d === 0){
				product = parseInt(number[i])*parseInt(number[i+1])*parseInt(number[i+2])*parseInt(number[i+3])*parseInt(number[i+4]);
			}else{
				product /= parseInt(number[i-1]);
			}
			console.log(product,number.substr(i,5));
			if(product>maxProduct){maxProduct = product;}
		}

		return maxProduct;
	};
}